CREATE TABLE student_engagement (
    Student_ID VARCHAR(20),
    Course_ID VARCHAR(20),
    Login_Frequency INT,
    Time_Spent_Modules DECIMAL(10,2),
    Participation_Forums INT,
    Quiz_Performance_Average DECIMAL(10,2),
    Assignment_Submissions INT,
    Resource_Access_Frequency INT,
    Session_Duration_Average DECIMAL(10,2),
    Device_Type VARCHAR(50),
    Internet_Bandwidth DECIMAL(10,2),
    Facial_Expression_Engagement DECIMAL(10,2),
    Emotional_State VARCHAR(50),
    Engagement_Level VARCHAR(50)
);

